    const { loading, error, data } = useQuery(GET_POKEMON_DETAILS, {variables:{"name":name}});
    if (loading) return <p>Loading...</p>;
    if (error) return <p>Error :(</p>;
    console.log(data);

    return (
    //console.log({name})
      <div key={name}>
          <p>hello</p>
      </div>
    );
};

export function Pokemon(props){
    console.log(props);

    return(
        <div key={props.pokemon.name} onClick={(e) => PokemonDetails(props.pokemon.name, e)}>
            <p>
                {props.pokemon.name} <img src={props.pokemon.image} alt="pokemon"></img>
            </p>
        </div>
    );
};
